// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IDroneOperator {
    function assignMission(uint _tenderId, address _operator) external;
}

contract MissionManager {
    address public government;
    IDroneOperator public droneOperatorContract;

    event ExternalMissionAssigned(uint indexed tenderId, address indexed operator);

    modifier onlyGovernment() {
        require(msg.sender == government, "Only government can assign missions");
        _;
    }

    constructor(address _droneOperatorContract) {
        government = msg.sender;
        droneOperatorContract = IDroneOperator(_droneOperatorContract);
    }

    function assignMissionExternally(uint _tenderId, address _operator) external onlyGovernment {
        droneOperatorContract.assignMission(_tenderId, _operator);
        emit ExternalMissionAssigned(_tenderId, _operator);
    }
}
